import React, { useState } from 'react';

const Blog = ({ blog }) => {
  const [view, setView] = useState(false);

  const toggleView = () => {
    setView(!view);
  };

  return (
    <div>
      <p>
        {blog.title} {blog.author}
        <button onClick={toggleView}>view</button>
      </p>
    </div>
  );
};

export default Blog;
